import './App.css';

class Header extends React.Component {	

render(){
	return(
<Router>
<div className='App-logo'>
<NavLink to="/"><img src = 'https://mwcm.nyt.com/.resources/mkt-wcm/dist/libs/assets/img/logo-nyt-header.svg' alt = 'logo'></img></NavLink>
//<Route path="/" exact component = {Header} />
</div>
</Router>
		)
}

}

export default Header;
